import { createRouter, createWebHistory } from 'vue-router'

import HomePage from '@/components/Home'
import WatAIPage from '@/components/WatAIPage'
import WaaromAIPage from '@/components/WaaromAIPage'
import WanneerAIPage from '@/components/WanneerAIPage'
import HoeAIPage from '@/components/HoeAIPage'
import VoorbeeldenPage from '@/components/VoorbeeldenPage'


const routes = [
  {
    path: '/',
    component: HomePage,
    children: [
        {
            path: 'home',
            component: HomePage
        },
        {
            path: 'wat',
            component: WatAIPage
        },
        {
            path: 'waarom',
            component: WaaromAIPage
        },
        {
            path: 'wanneer',
            component: WanneerAIPage
        },
        {
            path: 'hoe',
            components: HoeAIPage
        },
        {
            path: 'voorbeelden',
            components: VoorbeeldenPage
        }
    ]
  },
  {
    path: '/:pathMatch(.*)*',
    name: 'page-not-found'
  }

]




const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
})

router.beforeEach((to, from) => {
    console.log(to)
})

export default router
